import React from "react";
import { TextContainer, Box } from "./Styled";
import { HealthyHome, ZombieHome, EmptyHome } from "../../svg-icons";

const Home = () => (
  <>
    <TextContainer>Zombies</TextContainer>
    <Box>
      <p>A case where all can be infected</p>
      <div>
        <HealthyHome width="80" />
        <ZombieHome width="80" />
        <EmptyHome width="80" />
      </div>
      <p>A case with effective social distancing</p>
      <div>
        <HealthyHome width="80" />
        <ZombieHome width="80" />
        <EmptyHome width="80" />
      </div>
    </Box>
  </>
);

export default Home;
